import React from 'react';
// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className ="App">
        <input type="text" aria-required="true" size="225" value=""
     name="Search Repo" placeholder="Search Repo" style={{"height" : "2000", "width" : "300" ,"margin": "5px"}}/>
    <button style={{"height" : "80", "width" : "80"}}>Search</button>
    <p style={{"text-align": "center"}}>20 Results Found</p>
<div className="ui"><img src="https://avatars2.githubusercontent.com/u/31477944?s=460&v=4" /><p>Repo:<br />Owner:<br />
Fork Count:<br />Stars Count:</p></div>
</div>

  );
}

export default App;
